/**
Supplies the calling AGENCY constant's applicable RANGE constants as an array.
<p>
For example, <code>Isbn.LEBANON_1.ranges()[1]</code> returns 
<code>LEBANON_1__10_TO_39_RANGE</code>.
@return
<ul>
<li>
If the caller is an AGENCY constant, returns an array containing one RANGE constant for each 
of the caller's applicable ranges.
</li>
<li>
Returns an empty <code>Isbn</code> array if the caller is a RANGE, COMPONENT, 
or CONTEXT constant.
</li>
</ul>
@see #extent()
@see #getAgencyConstant()
*/

public Isbn[] ranges() {
if (this.getContext() == AGENCY) {
ArrayList<Isbn> ranges = new ArrayList<>();
for (Isbn constant : Isbn.values()) 
if (constant.getContext() == RANGE && constant.name().startsWith(this.name() + "__")) 
ranges.add(constant);
Collections.sort(ranges);
Isbn[] returnedRanges = new Isbn[ranges.size()];
return ranges.toArray(returnedRanges);
}
else return new Isbn[0];
}
/**
Supplies the maximum number of registrant elements/publisher prefixes that a given agency can 
currently assign according to RangeMessage.<!---->xml.
<p>
@return
<ul>
<li>
When called by an AGENCY constant, returns an <code>int</code> 
representing the maximum number of registrant elements (publisher prefixes) that the 
AGENCY constant can encompass.
<code>Isbn.LEBANON_0.extent()</code>, for example, returns <code>6940</code>.
</li>
<ul>
<li>
When called by <code>Isbn.UNKNOWN</code>, returns <code>0</code>.
</li>
</ul>
<li>
Returns <code>-1</code> when called by a RANGE, COMPONENT, or CONTEXT constant.
</li>
</ul>
@see #ranges()
@see #getMaximumAssigned()
@see #AGENCY
*/

public int extent() {
if (this.getContext() == AGENCY) {
int total = 0;
for (Isbn range : this.ranges()) total += range.getMaximumAssigned();
return total;
}
else return -1;
}
